// SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/AccessControl.sol";
import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/proxy/utils/Initializable.sol";

import "./ERC721WithRoyaltyCore.sol";

contract ERC721WithRoyalty is ERC721WithRoyaltyCore, ERC721, AccessControl, Initializable {
    bytes32 public constant ADMIN = keccak256("ADMIN");

    mapping(uint256 => string) private tokenToUri;

    string private _proxiedName;
    string private _proxiedSymbol;

    constructor() ERC721("", "") {}

    function initialize(
        string memory _name,
        string memory _symbol,
        address _royaltyReceiver,
        uint16 _royaltyPercentage,
        address admin
    ) external initializer {
        _proxiedName = _name;
        _proxiedSymbol = _symbol;
        _setDefaultRoyalty(TokenRoyalty({recipient: _royaltyReceiver, bps: _royaltyPercentage}));
        _setupRole(ADMIN, admin);
    }

    function setTokenRoyalties(TokenRoyaltyConfig[] calldata royaltyConfigs)
        external
        override
        onlyRole(ADMIN)
    {
        _setTokenRoyalties(royaltyConfigs);
    }

    function setDefaultRoyalty(TokenRoyalty calldata royalty) external override onlyRole(ADMIN) {
        _setDefaultRoyalty(royalty);
    }

    function exists(uint256 tokenId) public view returns (bool) {
        return _exists(tokenId);
    }

    function mintWithId(
        address to,
        uint256 tokenId,
        string calldata uri
    ) public onlyRole(ADMIN) {
        _mint(to, tokenId, uri);
    }

    function burn(uint256 tokenId) public {
        _burn(tokenId);
    }

    function tokenURI(uint256 tokenId) public view override returns (string memory) {
        require(_exists(tokenId), "ERC721Metadata: URI query for nonexistent token");

        return tokenToUri[tokenId];
    }

    function supportsInterface(bytes4 interfaceId)
        public
        view
        virtual
        override(ERC721, ERC721WithRoyaltyCore, AccessControl)
        returns (bool)
    {
        return super.supportsInterface(interfaceId);
    }

    function _mint(
        address to,
        uint256 tokenId,
        string calldata uri
    ) private {
        super._mint(to, tokenId);
        tokenToUri[tokenId] = uri;
    }

    function _safeMint(
        address to,
        uint256 tokenId,
        string calldata uri // bytes memory _data
    ) private {
        super._safeMint(to, tokenId);
        tokenToUri[tokenId] = uri;
    }

    function _safeMint(
        address to,
        uint256 tokenId,
        string calldata uri,
        bytes memory _data
    ) private {
        super._safeMint(to, tokenId, _data);
        tokenToUri[tokenId] = uri;
    }

    function name() public view virtual override returns (string memory) {
        return _proxiedName;
    }

    function symbol() public view virtual override returns (string memory) {
        return _proxiedSymbol;
    }
}
